    return (
        <>
            <Header headerType={0} />
            <main style={{
                minHeight:winSize[1],
                background: `no-repeat center/100% url('/img/main_back_img.jpg')`,
                opacity: '0.85',
                }}>

            </main>
        </>
    );
};

export default Home;
